//generates a list from [0]->[99] of random numbers between 0-3
int* randomColumn(){
    static int array[100];
    for (int i=0; i<100; i++){
        array[i] = rand() % 4;
    }
    return array;
}

//generates a list from [0]->[99] of random numbers between 0-3
int* randomSurprise(){
    static int array[100];
    for (int i=0; i<100; i++){
        if(rand() % 2 == 1){  
            array[i] = rand() % 4+1;
        } else {
            array[i] = 0;
        }
        printf("%d",array[i]);
    }
    return array;
}

