        correct = 0;
        score = 0;
        gameEnd = false;
        firstPress = true;
        highscore = false;
        animateX = 0;
        animateY = 0;
        gameOver = false;
        clearOnce = 0; //clears 2 buffers
        animateTile = false;
        startGame = true;
        timer = 99;
        
        animate = 0;
        animateTileCount = 0;
        gameOverWait = false;
